import { Provider } from "react-redux";
import "./App.css";
import Time from "./components/Time";
import store from "./redux/store";

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <h1>
          <Time />
        </h1>
      </div>
    </Provider>
  );
}

export default App;
